{'message': '《那夜凌晨，我坐上了旺角開往大埔的紅van》（Lost on a Red Minibus to Taipo）是一部香港網絡小說，由高登會員Mr.Pizza（高登ID：331715）創作，獲得好評，及後出版成實體書籍，並將會改編成電影。 
故事內容講述主角游梓池（阿池）某夜凌晨乘坐旺角前往大埔的紅色小巴，穿過獅子山隧道後發現世上所有人及汽車竟一下子無故消失，只剩下小巴及車內十七人留在無人無車的大埔，但後來又出現來歷不明的神秘面具人，以及小巴上的十七人部份無故死亡。

', 'plat': 0, 'device': ''}

{'message': '(°∀°)ﾉ projectVectors就是这个新方法吧。我也试过了，没想到有人也和我一样想试试这玩意的性能，看看能不能做个3D游戏。

这测试看起来至少能支持3200个面啊也就是3个左右的低模了？ 
我很想做个载入模型和动画的，我比较擅长引擎和图形学，不过这玩意太费时间了，一直没空做，大大们有什么新发现新技术也多多发出来交流嘛~ 现在的渲染性能还是有待提高，好想有一天能做一个弹幕的3D引擎， 大大们有什么交流群之类的么？', 'plat': 0, 'device': ''}

