{'message': 'customode.exe可以进自定义竞技场模式，但是需要把前几个竞技场难度打通，并且存档位置是在C盘下C:\Users\用户的名字\AppData\Roaming\FALCOM\ED_SORA3
如果不确定存档位置可以customode.exe启动后过完初始剧情存个档再搜下，找到存档位置后可以把save文件夹下的存档复制过去，然后从太阳门进入竞技场，打通前几个难度就行

3rdpsp.exe进入是修罗真姿的补丁，具体就自己进去看了，时间太久远我也有点忘了', 'plat': 0, 'device': ''}

{'message': '看了看最后大决战，航母的小飞机吃了大量的对空火力，妈妈船保护后排巨像，因为相互之间占体积的比较少，白球不朽可以从巨像腿间走上***，反而人类各种挤压体积……这难道就是现在P这么IMBA的真相？阵型简单，输出厚重。

…………………………

我是口胡的。', 'plat': 0, 'device': ''}

